 import { useEffect, useState } from "react"
// import { useDispatch,} from "react-redux"

import { getAllProduct } from "../thanks/ThankProduct";
// import './'
//קומפוננטה
export const ListProduct=()=>{

let [myprod,setmyprod ] = useState()
//פונקציה שמורה שמציגה את הנתונים בעת טעינת הדף
  useEffect(
   async () => {
     //משתנה שמכניס בתוכו את כל המsetmyprodוצרים
    let getPro =await getAllProduct ();
    console.log(getPro)
    setmyprod(getPro)
   
   },
   []
  )
   
    return<>
  
  <table>
        <tr>
            <th>קוד מוצר</th>
            <th>שם מוצר</th>
            <th>תמונת מוצר</th>
            <th></th>
        </tr>
        { 
            myprod != undefined && 
            myprod.length > 0 &&
            myprod.map((item) =>
            <tr>
                <td>{item.id}</td>  
                <td>{item.name}</td>  
            </tr>
            )
        }
        
    </table>
    </>
}
